import React from 'react'
import style from './Tabs.module.scss'

class SecondTabs extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div className={style.lowerTabs}>
                <div className='secondTitle'>
                <p>Overview - Today</p>
                </div>
                {
                    this.props.secondTabList.map((tab) => (
                        <div className={style.lowerTab}>
                            {tab.type} <img src={tab.icon}></img>
                            {tab.number}
                            <span style={{ color: tab.colorRate }}><img src={tab.upOrDown}></img>{tab.rate}</span>
                        </div>
                    ))
                }
            </div>
        )
    }

}

export default SecondTabs
